import React from 'react'
import NavBar from '../../components/NavBar/NavBar'
import AboutUs from '../../components/AboutUS/AboutUs'
import './About.css'

const About = () => {
  return (
    <div className="About">
      <NavBar/> 
      <AboutUs/> 
    </div>
    );
}
        
export default About
